import '../Navbar/Navbar.css';


class Layout extends Component {
    constructor(props) {
        super(props);
    }
    state = {  }
    render() { 
        return ( 
        <div>
            <Grid container>
                <Grid item xs={3} className="left_container" >
                    <LeftPanel/>
